import pandas as pd
import numpy as np
from scipy.signal import savgol_filter
import matplotlib.pyplot as plt


def f(array):
    min_value = min([len(array[i]) for i in range(len(array))])
    array = [array[i][:min_value] for i in range(len(array))]
    # [len(array[i]) for i in range(len(array))]
    # array_means = []

    array = [savgol_filter(array[i], 51, 3) for i in range(len(array))]

    array_means = np.mean(array, axis=0)
    array_stds = np.std(array, axis=0)
    return array_means, array_stds


def plot_array(array_means, array_stds, string):
    plt.errorbar(range(len(array_means)), array_means, yerr=array_stds)
    # plt.xlabel('iteration', fontsize=15)
    # plt.ylabel('% CKDE nodes', fontsize=15)
    plt.xticks(range(0, 1600, 250), fontsize=15)
    plt.yticks(np.arange(0, 1.25, 0.5), np.arange(0, 125, 50), fontsize=15)
    plt.title(string, fontsize=15)


def f2_array(array, length):
    for i in range(len(array)):
        aux = np.mean(array[i][-10:-1])
        while len(array[i]) < length:
            array[i].append(np.random.uniform(aux - 0.1, aux + 0.1))
    array = np.array(array)
    '''array[array > 1.0] = 1.0
    array[array < 0.0] = 0.0'''

    lens = [len(i) for i in array]
    mins = min(lens)
    array = [array[i][:mins] for i in range(len(array))]
    return array


